import React from 'react';

















import './CardSkillSection.css';
















const skills = [
  {
    name: 'HTML',
    icon: 'fab fa-html5',
    description: 'Experience building websites using HTML5'
    
  },
  {
    name: 'CSS',
    icon: 'fab fa-css3-alt',
    description: 'Experience styling websites using CSS3'
  },
  {
    name: 'BOOTSTRAP',
    icon: 'fa-brands fa-bootstrap',
    description: 'Experience styling websites using CSS3'
  },
  {
    name: 'JavaScript',
    icon: 'fa-brands fa-square-js',
    description: 'My ignorance in javascripts is Senior.'
  },
  {
    name: 'React',
    icon: 'fab fa-react',
    description: 'My knowledge in React is Intermediate.'
  },
  {
    name: 'Node.js',
    icon: 'fa-brands fa-node',
    description: 'My knowledge in javascripts is Beginner.'
  }
];

const CardSkillSection = () => {
  return (
    <div className="card-skill-section">
      <div className="container">
        <h2 className="section-title">My Skills</h2>
        <p className='section-text'>Below are the technologies that I have more or less experience with</p>
        <div className="card-container">
          {skills.map((skill, index) => (
            <div key={index} className="card">
              <div className="icon-container">
                <i className={skill.icon}></i>
              </div>
              <h3 className="card-title">{skill.name}</h3>
              <p className="card-text">{skill.description}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default CardSkillSection;
